def euler_cycle(matrix):
    n = len(matrix)
    degree = [0] * n
    for i in range(n):
        for j in range(n):
            degree[i] += matrix[i][j]

    if sum(degree.count(x) for x in set(degree)) != 2*n:
        return "NO"

    odd_degree = 0
    for d in degree:
        if d % 2:
            odd_degree += 1
        if odd_degree > 2:
            return "NO"

    visited = [False] * n
    path = [0]
    for i in range(1, n):
        if not visited[i]:
            if not matrix[path[-1]][i]:
                return "NO"
            path.append(i)
            visited[i] = True

    for i in range(n - 1):
        if not matrix[path[-1]][path[i]]:
            return "NO"

    return "YES"

