def gcd(a, b):
    if b == 0:
        return a
    return gcd(b, a % b)

def lcm(a, b):
    return abs(a * b) // gcd(a, b)

def play(numbers):
    n = len(numbers)
    max_num = max(numbers)
    board = set(numbers)

    while True:
        for i in range(n - 1):
            for j in range(i + 1, n):
                diff = lcm(numbers[i], numbers[j]) - numbers[i] - numbers[j]
                if diff > max_num and diff not in board:
                    board.add(diff)
                    max_num += 1
                    break
        else:
            break

    return max_num

