    dp = [[0] * k for _ in range(n)]
    for i in range(1, n):
        for j in range(1, k):
            dp[i][j] = dp[i - 1][j] + (1 if colors[i] != colors[i - 1] and dp[i - 2][colors[i - 1]] < dp[i - 1][j] else 0)
    max_len = 0
    for i in range(1, k):
