def adjacents(n, x, y=None):
    if y is None:
        y = table.index(list(table)[x])
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
    result = []
    for dx, dy in directions:
        nx, ny = x + dx * n, y + dy * n
        if 0 <= nx < n and 0 <= ny < n:
            result.append((nx, ny))
    return result

