def find_words(table, words):
    def dfs(x, y, word, visited):
        if len(word) == 0:
            return True
        for dx, dy in [(0, 1), (1, 0), (0, -1), (-1, 0)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < n and 0 <= ny < n and not visited[nx][ny] and table[nx][ny] == word[0]:
                visited[nx][ny] = True
                if dfs(nx, ny, word[1:], visited):
                    return True
                visited[nx][ny] = False
        return False

    n = len(table)
    for word in words:
        visited = [[False] * n for _ in range(n)]
        found = False
        for i in range(n):
            for j in range(n):
                if table[i][j] == word[0]:
                    visited[i][j] = True
                    if dfs(i, j, word[1:], visited):
                        found = True
                        for k in range(n):
                            for l in range(n):
                                if visited[k][l]:
                                    table[k][l] = ' '
                        break
                    visited[i][j] = False
        if not found:
            return 'No solution'
    return ''.join(sorted(''.join(table).replace(' ', '')))

