def life_squared(n, t, grid):
    for _ in range(t):
        new_grid = [[0] * n for _ in range(n)]
        for i in range(n):
            for j in range(n):
                neighbors = 0
                for x in range(i - 1, i + 2):
                    for y in range(j - 1, j + 2):
                        if 0 <= x < n and 0 <= y < n and grid[x][y] == 1:
                            neighbors += 1
                if grid[i][j] == 1:
                    neighbors -= 1
                if (grid[i][j] == 1 and 2 <= neighbors <= 3) or (grid[i][j] == 0 and neighbors == 3):
                    new_grid[i][j] = 1
        grid = new_grid
    return grid

