def bfs(graph, start, y):
    visited = [False] * (y + 1)
    queue = [start]
    visited[start] = True

    while queue:
        current = queue.pop(0)
        for next in range(current + 1, y + 1):
            if not visited[next] and next in graph[current]:
                queue.append(next)
                visited[next] = True

    return max(range(y + 1)) if max(visited) < y else -1

