def gcd(a, b):
    while b != 0:
        a, b = b, a % b
    return a

def lcm(a, b):
    return a * b // gcd(a, b)

def find_min_time(p, a, b, c):
    min_time = lcm(lcm(a, b), c)
    while min_time < p:
        min_time += lcm(lcm(a, b), c)
    return min_time - p

