    for i in range(A, B+1):
        if sum_digits(i) == C:
            return i, i

    T = 10000
    for i in range(1, T):
        if A <= i <= T and sum_digits(i) == C:
            T = i

    M = 1
    for i in range(M, B+1, -1):
        if A <= i <= B and sum_digits(i) == C:
