def solve(n, days):
    days_list = list(range(1, n+1))
    for i in range(n):
        if days[i] > 0:
            for j in range(days[i]):
                days_list[i+j] += 1
    result = ['-'] * n
    for i in range(n):
        if days_list[i] > 0:
            result[i] = '+'
    for i in range(n, len(days_list)):
        if days_list[i] > 0:
            result.append('+')
    return ' '.join(result)

