def travel_time(path):
    x, y, time = 0, 0, 0
    for move in path:
        if move == 'U':
            time += 4 * (y + 1) if (y + 1, x) not in ((i, j) for i, j in enumerate(path)) else y + 1
            y += 1
        elif move == 'D':
            time += 4 * y if (y - 1, x) not in ((i, j) for i, j in enumerate(path)) else y - 1
            y -= 1
        elif move == 'L':
