def max_horizontality(n, m):
    if n < 2 or m < 2:
        return 0

    max_h = min(n, m)
    for i in range(2, min(n, m) + 1):
        h = 0
        for j in range(1, n // i + 1):
            if (n % i == 0) and (m >= i * (j - 1)):
                h += i
        max_h = max(max_h, h)

