def find_finalists(n, matrix):
    battles = [[] for _ in range(n)]
    for i in range(n):
        for j in range(n):
            if i != j:
                battles[i].append((j, matrix[i][j]))
    winners = set()
    for robot, results in enumerate(battles):
        if all(res[1] == 0 for res in results):
            winners.add(robot)
    return len(winners), sorted(list(winners))

