def adjacent_cells(n):
    row = (n - 1) // 8
    col = (n - 1) % 8
    neighbors = []

    if row > 0:
        neighbors.append(n - 8)  # above
    if row < 7:
        neighbors.append(n + 8)  # below
    if col > 0:
        neighbors.append(n - 1)  # left
    if col < 7:
        neighbors.append(n + 1)  # right

    neighbors.sort()
    return ' '.join(map(str, neighbors))

