def can_distribute(max_time, n, k, s, candies):
    team_count = 1
    current_sum = 0
    for candy in candies:
        if current_sum + candy > max_time * s:
            team_count += 1
            current_sum = candy
            if team_count > k:
                return False
        else:
            current_sum += candy
    return True

def find_min_time(n, k, s, candies):
    left, right = max(candies) // s, sum(candies) // s
    while left < right:
        mid = (left + right) // 2
        if can_distribute(mid, n, k, s, candies):
            right = mid
        else:
            left = mid + 1
    return left

