def min_time_to_eat_candies(n, k, s, bags):
    def can_finish_in_time(mid):
        total_time = 0
        for i in range(n):
            total_time += (bags[i] + s - 1) // s
        return total_time <= mid * k

    left, right = 1, sum(bags) // s + 1
    while left < right:
        mid = (left + right) // 2
        if can_finish_in_time(mid):
            right = mid
        else:
            left = mid + 1
    return left

