coding = zip(
    [100, 90, 50, 40, 10, 9, 5, 4, 1],
    ["C", "XC", "L", "XL", "X", "IX", "V", "IV", "I"]
)


def decToRoman(num):
    result = []
    for d, r in coding:
        while num >= d:
            result.append(r)
            num -= d
    return ''.join(result)

num = input()
print(decToRoman(int(num)))

