def isRobotWin(n):
    dp = [False] * (n + 1)

    for i in range(2, n + 1):
        dp[i] = True
    for j in range(1, i // 2 + 1):
        if i % j == 0 and not (dp[i - j]):
            dp[i] = False
            break

    return "ROBOT" if dp[n] else "NOT ROBOT"

