def count_lucky_numbers(length):
    dp = [[0] * 10 for _ in range(length + 1)]

    for i in range(10):
        dp[1][i] = 1

    for l in range(2, length + 1):
        for d in range(10):
            for x in range(d + 1):
                dp[l][d] += dp[l - 1][x]

    count = sum(dp[length])
    return count


