def count_lucky_numbers(length):
    dp = [[0] * 10 for _ in range(length + 1)]

    for j in range(10):
        dp[1][j] = 1

    # ÐÐ°Ð¿Ð¾Ð»Ð½ÑÐµÐ¼ Ð¼Ð°ÑÑÐ¸Ð² dp
    for i in range(2, length + 1):
        for j in range(10):
            for k in range(j + 1):
                dp[i][j] += dp[i - 1][k]
    count = sum(dp[length])

    return count

