def min_time_to_eat_candies(n, k, s, candies):
    left, right = 1, sum(candies) // s + (1 if sum(candies) % s > 0 else 0)

    while left < right:
        mid = (left + right) // 2
        if can_finish_in_time(candies, k, s, mid):
            right = mid
        else:
            left = mid + 1

    return left

